sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
var gd=inputs.response;
var gr=JSON.parse(gd);
outputs.amount_due = gr.analyzeResult.documents[0].fields.AmountDue.content;
outputs.billing_address = gr.analyzeResult.documents[0].fields.BillingAddress.content;
outputs.total_tax = gr.analyzeResult.documents[0].fields.TotalTax.content;
outputs.total_discount = gr.analyzeResult.documents[0].fields.TotalDiscount.content;
outputs.sub_total = gr.analyzeResult.documents[0].fields.SubTotal.content;
outputs.payment_term = gr.analyzeResult.documents[0].fields.PaymentTerm.content;
outputs.invoice_total = gr.analyzeResult.documents[0].fields.InvoiceTotal.content;
outputs.invoice_number = gr.analyzeResult.documents[0].fields.InvoiceId.content;
outputs.invoice_date = gr.analyzeResult.documents[0].fields.InvoiceDate.content;
outputs.due_date = gr.analyzeResult.documents[0].fields.DueDate.content;
outputs.customer_name = gr.analyzeResult.documents[0].fields.CustomerName.content;
outputs.billing_address_recepient = gr.analyzeResult.documents[0].fields.BillingAddressRecipient.content;


})(inputs, outputs);

